export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},u1PeR06cDT:{data:{id:403,attributes:{imdbId:"tt0914798",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTMzMTc3MjA5NF5BMl5BanBnXkFtZTcwOTk3MDE5MQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.8\u002F10"},{Source:"Rotten Tomatoes",Value:"64%"},{Source:"Metacritic",Value:"55\u002F100"}],item_lang:{data:{id:1066,attributes:{title:e,plot:"Bruno an eight-year-old boy from Berlin, Germany is moved with his mother, Elder sister, SS Commander father to a countryside in Europe where his father powers over a concentration camp for Jews. Bruno went \"exploring\" one day and befriended a child his age named Shmuel. Shmuel was a Jew. The boy became good friends until Bruno was scheduled to move to a new location.",slug:"the-boy-in-the-striped-pajamas"}}},books:{data:[{id:3396,attributes:{title:"The Boy in the Striped Pyjamas",description:"Lines may divide us, but hope will unite us. Nine year old Bruno knows nothing of the Final Solution and the Holocaust. He’s oblivious to the appalling cruelties being inflicted on the people of Europe by his country. All he knows is that he has moved from Berlin to a desolate area where he has no one to play with. Until he meets Shmuel. Shmuel lives in a strange parallel existence on the other side of the adjoining wire fence, where everyone wears a uniform of striped pyjamas. Despite the wire fence separating them, the two boys become best friends. As they grow closer, Bruno starts to learn the terrible truth that lies beyond the fence, and what life is like for his friend. John Boyne’s classic novel explores the friendship and loss of innocence of Bruno and Shmuel, during one of the worst points in history.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FKMAmEWLim8C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"2010-02-23",publisher:"Random House",subtitle:a}},{id:3397,attributes:{title:e,description:"Two young boys encounter the best and worst of humanity during the Holocaust in this powerful read that USA Today called \"as memorable an introduction to the subject as The Diary of Anne Frank.” Berlin, 1942: When Bruno returns home from school one day, he discovers that his belongings are being packed in crates. His father has received a promotion and the family must move to a new house far, far away, where there is no one to play with and nothing to do. A tall fence stretches as far as the eye can see and cuts him off from the strange people in the distance. But Bruno longs to be an explorer and decides that there must be more to this desolate new place than meets the eye. While exploring his new environment, he meets another boy whose life and circumstances are very different from his own, and their meeting results in a friendship that has devastating consequences.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=p-2s2PWArTQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2008-12-18",publisher:"David Fickling Books",subtitle:a}},{id:3398,attributes:{title:e,description:"Bored and lonely after his family moves from Berlin to a place called \"Out-With\" in 1942, Bruno, the son of a Nazi officer, befriends a boy in striped pajamas who lives behind a wire fence. Reprint.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dpCzx9Ho52UC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2006-01-01",publisher:"Ember",subtitle:"A Fable"}},{id:3399,attributes:{title:"The Boy in the Striped Pajamas (Deluxe Illustrated Edition)",description:"\"Berlin 1942. When Bruno returns home from school one day, he discovers that his belongings are being packed in crates. His father has received a promotion and the family must move from their home to a new house far far away, where there is no one to play with and nothing to do. A tall fence running alongside stretches as far as the eye can see and cuts him off from the strange people he can see in the distance. But Bruno longs to be an explorer and decides that there must be more to this desolate new place than meets the eye. While exploring his new environment, he meets another boy whose life and circumstances are very different from his own, and their meeting results in a friendship that has devastating consequences.\"--Publisher's description.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JVr9jwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2016-10-11",publisher:"Knopf Books for Young Readers",subtitle:a}},{id:3400,attributes:{title:"A Literature Kit for The Boy in the Striped Pajamas by John Boyne",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=5eXMtwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Lynda Allison"],firstBook:d,published:"2015-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681703489170}}("","movie","John Boyne",null,"The Boy in the Striped Pajamas","series",1))